//vercel.com/"},vsc:{name:"VS Code",icon:n.p+"static/media/vsc.38c43cb0e3f7a5018477.png",link:"https://code.visualstudio.com/"},vue:{name:"Vue",icon:n.p+"static/media/vue.77649c72687b06cfbacf.png",link:"https://vuejs.org/"}}),y=[{icon:g,company:"Turion Space",title:"Ground Software Engineer",period:"Oct. 2024 - Present",links:{Website:"https://turionspace.com/"},description1:"At Turion Space, I work across multiple projects and teams to align on requirements, quickly learn technical concepts, and lead feature development. I also play a key role in onboarding by writing and updating documentation for new hires and interview candidates. Some of the projects I've contributed to include developing critical testing software for Turion Space's DROID.002 satellite, assisting in the development of our mission control system, and feature development for STARFIRE OS, a web and API-based platform for customers to interact with and buy satellite imagery.",description2:"I work with a wide range of technologies, building efficient frontend and backend systems, along with automated scripts, using Go, Python, Ruby, and JavaScript. On the frontend, I design responsive, user-focused websites with React, Vue, and TypeScript. My work often intersects with space and satellite technology, giving me the opportunity to learn about different engineering disciplines such as AI/ML pipelines and flight software C code. We prioritize modern tools and best practices to deliver scalable, high-performance software that meets both our internal needs and those of our customers.",stack:[h.c,h.css3,h.docker,h.git,h.github,h.go,h.html5,h.javascript,h.linux,h.nodejs,h.postgresql,h.postman,h.python,h.react,h.ruby,h.sql,h.tailwind,h.typescript,h.vue]},{icon:m,company:"Headstarter AI",title:"Software Engineering Fellow",period:"Jul. 2024 - Sep. 2024",links:{Website:"https://headstarter.co/"},description1:"To sharpen my skills the summer after graduating college, I participated in a software engineering fellowship that focused on learning new technologies, conducting mock interviews, and attending weekly Zoom sessions with experienced professionals and startup founders. It was an eye-opening experience to gain outside, professional feedback on my work and see how others approached similar challenges. I learned a lot about the software engineering industry, how to think more strategically about system design, and how to train to become a top 1% engineer.",description2:"During the fellowship, I worked on various projects from design to deployment, collaborating with other fellows using MVC design patterns. We formed teams to develop AI-driven applications similar to real-world use cases, such as a music recommendation chatbot. Through this experience, I gained hands-on exposure to Agile methodologies, CI/CD, Git, and microservice architecture. It was insightful to see how different teams approached problem-solving and system design, and I came away with a much deeper understanding of software development in a team setting. Along the way, I also expanded my technical stack, learning Next.js, Stripe, OpenAI, MaterialUI, and more.",stack:[h.bootstrap,h.css3,h.express,h.git,h.github,h.html5,h.javascript,h.materialui,h.nextjs,h.nodejs,h.openai,h.react,h.redux,h.stripe,h.tailwind,h.typescript,h.vercel,h.vsc]},{icon:A,company:"Coding Minds, Inc.",title:"Part-Time Instructor",period:"Sep. 2022 - Jan. 2023",links:{Website:"https://codingmind.com/"},description1:"At Coding Minds, I mentored students of all ages and skill levels through interactive lessons and hands-on projects, focusing on programming fundamentals and best coding practices. The projects ranged from building a scrolling rocket game to developing a racecar game in Unity, allowing students to apply their skills in creative and engaging ways. I also provided guidance on debugging, code optimization, and project planning, helping students build good habits while coding. It taught me the hardships of teaching to complete beginners and how to adapt to different learning styles and paces.",description2:"I taught programming languages like Python, Java, and C++, tailoring lessons to different learning styles and experience levels. This was done through self-created coding challenges and exercises, curated to help them learn the concepts for the particular lesson. Additionally, I worked alongside experienced instructors to guide my teaching approach, incorporating techniques like gamification and connecting lessons to students' personal interests to make learning more engaging and effective.",stack:[h.cplusplus,h.java,h.python,h.replit,h.unity]}],v=[{icon:g,company:"Turion Space",title:"\u039c\u03b7\u03c7\u03b1\u03bd\u03b9\u03ba\u03cc\u03c2 \u039b\u03bf\u03b3\u03b9\u03c3\u03bc\u03b9\u03ba\u03bf\u03cd \u0395\u03b4\u03ac\u03c6\u03bf\u03c5\u03c2",period:"\u039f\u03ba\u03c4. 2024 - \u03a0\u03b1\u03c1\u03cc\u03bd",links:{Website:"https://turionspace.com/"},description1:"\u03a3\u03c4\u03bf Turion Space, \u03b5\u03c1\u03b3\u03ac\u03b6\u03bf\u03bc\u03b1\u03b9 \u03c3\u03b5 \u03c0\u03bf\u03bb\u03bb\u03ac \u03c0\u03c1\u03cc\u03c4\u03b6\u03b5\u03ba\u03c4 \u03ba\u03b1\u03b9 \u03bf\u03bc\u03ac\u03b4\u03b5\u03c2 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03b5\u03c5\u03b8\u03c5\u03b3\u03c1\u03b1\u03bc\u03bc\u03af\u03c3\u03c9 \u03c4\u03b9\u03c2 \u03b1\u03c0\u03b1\u03b9\u03c4\u03ae\u03c3\u03b5\u03b9\u03c2, \u03bd\u03b1 \u03bc\u03ac\u03b8\u03c9 \u03b3\u03c1\u03ae\u03b3\u03bf\u03c1\u03b1 \u03c4\u03b5\u03c7\u03bd\u03b9\u03ba\u03ad\u03c2 \u03ad\u03bd\u03bd\u03bf\u03b9\u03b5\u03c2 \u03ba\u03b1\u03b9 \u03bd\u03b1 \u03bf\u03b4\u03b7\u03b3\u03ae\u03c3\u03c9 \u03c4\u03b7\u03bd \u03b1\u03bd\u03ac\u03c0\u03c4\u03c5\u03be\u03b7 \u03c7\u03b1\u03c1\u03b1\u03ba\u03c4\u03b7\u03c1\u03b9\u03c3\u03c4\u03b9\u03ba\u03ce\u03bd. \u03a0\u03b1\u03af\u03b6\u03c9 \u03b5\u03c0\u03af\u03c3\u03b7\u03c2 \u03ba\u03b1\u03af\u03c1\u03b9\u03bf \u03c1\u03cc\u03bb\u03bf \u03c3\u03c4\u03b7\u03bd \u03b5\u03bd\u03c3\u03c9\u03bc\u03ac\u03c4\u03c9\u03c3\u03b7 \u03b3\u03c1\u03ac\u03c6\u03bf\u03bd\u03c4\u03b1\u03c2 \u03ba\u03b1\u03b9 \u03b5\u03bd\u03b7\u03bc\u03b5\u03c1\u03ce\u03bd\u03bf\u03bd\u03c4\u03b1\u03c2 \u03c4\u03b7\u03bd \u03c4\u03b5\u03ba\u03bc\u03b7\u03c1\u03af\u03c9\u03c3\u03b7 \u03b3\u03b9\u03b1 \u03bd\u03ad\u03bf\u03c5\u03c2 \u03c5\u03c0\u03b1\u03bb\u03bb\u03ae\u03bb\u03bf\u03c5\u03c2 \u03ba\u03b1\u03b9 \u03c5\u03c0\u03bf\u03c8\u03ae\u03c6\u03b9\u03bf\u03c5\u03c2 \u03c3\u03c5\u03bd\u03b5\u03bd\u03c4\u03b5\u03cd\u03be\u03b5\u03c9\u03bd. \u039a\u03ac\u03c0\u03bf\u03b9\u03b1 \u03b1\u03c0\u03cc \u03c4\u03b1 \u03c0\u03c1\u03cc\u03c4\u03b6\u03b5\u03ba\u03c4 \u03c3\u03c4\u03b1 \u03bf\u03c0\u03bf\u03af\u03b1 \u03c3\u03c5\u03bd\u03ad\u03b2\u03b1\u03bb\u03b1 \u03c0\u03b5\u03c1\u03b9\u03bb\u03b1\u03bc\u03b2\u03ac\u03bd\u03bf\u03c5\u03bd \u03c4\u03b7\u03bd \u03b1\u03bd\u03ac\u03c0\u03c4\u03c5\u03be\u03b7 \u03ba\u03c1\u03af\u03c3\u03b9\u03bc\u03bf\u03c5 \u03bb\u03bf\u03b3\u03b9\u03c3\u03bc\u03b9\u03ba\u03bf\u03cd \u03b4\u03bf\u03ba\u03b9\u03bc\u03ce\u03bd \u03b3\u03b9\u03b1 \u03c4\u03bf \u03b4\u03bf\u03c1\u03c5\u03c6\u03cc\u03c1\u03bf DROID.002 \u03c4\u03b7\u03c2 Turion Space, \u03c4\u03b7\u03bd \u03c5\u03c0\u03bf\u03c3\u03c4\u03ae\u03c1\u03b9\u03be\u03b7 \u03c3\u03c4\u03b7\u03bd \u03b1\u03bd\u03ac\u03c0\u03c4\u03c5\u03be\u03b7 \u03c4\u03bf\u03c5 \u03c3\u03c5\u03c3\u03c4\u03ae\u03bc\u03b1\u03c4\u03bf\u03c2 \u03b5\u03bb\u03ad\u03b3\u03c7\u03bf\u03c5 \u03b1\u03c0\u03bf\u03c3\u03c4\u03bf\u03bb\u03ae\u03c2 \u03bc\u03b1\u03c2, \u03ba\u03b1\u03b9 \u03c4\u03b7 \u03b4\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03af\u03b1 \u03c4\u03bf\u03c5 STARFIRE OS, \u03b5\u03bd\u03cc\u03c2 \u03c0\u03bb\u03b1\u03c4\u03c6\u03cc\u03c1\u03bc\u03b1\u03c2 \u03b2\u03b1\u03c3\u03b9\u03c3\u03bc\u03ad\u03bd\u03b7\u03c2 \u03c3\u03b5 \u03b9\u03c3\u03c4\u03bf\u03c3\u03b5\u03bb\u03af\u03b4\u03b5\u03c2 \u03ba\u03b1\u03b9 API \u03b3\u03b9\u03b1 \u03c0\u03b5\u03bb\u03ac\u03c4\u03b5\u03c2 \u03bd\u03b1 \u03b1\u03bb\u03bb\u03b7\u03bb\u03b5\u03c0\u03b9\u03b4\u03c1\u03bf\u03cd\u03bd \u03ba\u03b1\u03b9 \u03bd\u03b1 \u03b1\u03b3\u03bf\u03c1\u03ac\u03b6\u03bf\u03c5\u03bd \u03b5\u03b9\u03ba\u03cc\u03bd\u03b5\u03c2 \u03b4\u03bf\u03c1\u03c5\u03c6\u03cc\u03c1\u03c9\u03bd.",description2:"\u0395\u03c1\u03b3\u03ac\u03b6\u03bf\u03bc\u03b1\u03b9 \u03bc\u03b5 \u03bc\u03b9\u03b1 \u03b5\u03c5\u03c1\u03b5\u03af\u03b1 \u03b3\u03ba\u03ac\u03bc\u03b1 \u03c4\u03b5\u03c7\u03bd\u03bf\u03bb\u03bf\u03b3\u03b9\u03ce\u03bd, \u03ba\u03b1\u03c4\u03b1\u03c3\u03ba\u03b5\u03c5\u03ac\u03b6\u03bf\u03bd\u03c4\u03b1\u03c2 \u03b1\u03c0\u03bf\u03b4\u03bf\u03c4\u03b9\u03ba\u03ac \u03c3\u03c5\u03c3\u03c4\u03ae\u03bc\u03b1\u03c4\u03b1 frontend \u03ba\u03b1\u03b9 backend, \u03bc\u03b1\u03b6\u03af \u03bc\u03b5 \u03b1\u03c5\u03c4\u03bf\u03bc\u03b1\u03c4\u03bf\u03c0\u03bf\u03b9\u03b7\u03bc\u03ad\u03bd\u03b1 \u03c3\u03b5\u03bd\u03ac\u03c1\u03b9\u03b1, \u03c7\u03c1\u03b7\u03c3\u03b9\u03bc\u03bf\u03c0\u03bf\u03b9\u03ce\u03bd\u03c4\u03b1\u03c2 Go, Python, Ruby, \u03ba\u03b1\u03b9 JavaScript. \u03a3\u03c4\u03bf frontend, \u03c3\u03c7\u03b5\u03b4\u03b9\u03ac\u03b6\u03c9 \u03b1\u03bd\u03c4\u03b1\u03c0\u03bf\u03ba\u03c1\u03b9\u03bd\u03cc\u03bc\u03b5\u03bd\u03b5\u03c2, \u03b5\u03c3\u03c4\u03b9\u03b1\u03c3\u03bc\u03ad\u03bd\u03b5\u03c2 \u03c3\u03c4\u03bf\u03bd \u03c7\u03c1\u03ae\u03c3\u03c4\u03b7 \u03b9\u03c3\u03c4\u03bf\u03c3\u03b5\u03bb\u03af\u03b4\u03b5\u03c2 \u03bc\u03b5 React, Vue, \u03ba\u03b1\u03b9 TypeScript. \u0397 \u03b4\u03bf\u03c5\u03bb\u03b5\u03b9\u03ac \u03bc\u03bf\u03c5 \u03c3\u03c5\u03c7\u03bd\u03ac \u03c4\u03ad\u03bc\u03bd\u03b5\u03c4\u03b1\u03b9 \u03bc\u03b5 \u03c4\u03b7\u03bd \u03c4\u03b5\u03c7\u03bd\u03bf\u03bb\u03bf\u03b3\u03af\u03b1 \u03b4\u03b9\u03b1\u03c3\u03c4\u03ae\u03bc\u03b1\u03c4\u03bf\u03c2 \u03ba\u03b1\u03b9 \u03b4\u03bf\u03c1\u03c5\u03c6\u03cc\u03c1\u03c9\u03bd, \u03b4\u03af\u03bd\u03bf\u03bd\u03c4\u03ac\u03c2 \u03bc\u03bf\u03c5 \u03c4\u03b7\u03bd \u03b5\u03c5\u03ba\u03b1\u03b9\u03c1\u03af\u03b1 \u03bd\u03b1 \u03bc\u03ac\u03b8\u03c9 \u03